export function Cart(propss) {
    <div className="col-md-6">
    <h3>cart</h3>
    <table className="table table-dark table-bordered">
      <thead>
        <tr>
          <th>product</th>
          <th>price</th>
          <th>count</th>
          <th>subtotal</th>
          <th>actions</th>
        </tr>
      </thead>
      <tbody>
        {
          propss.date2.map(elm => {
            return <tr key={elm.id}>
              <td>{elm.title}</td>
              <td>{elm.price}</td>
              <td>{elm.count}</td>
              <td>{elm.count * elm.price}</td>
              <td onClick={()=>mpr}></td>
              {/* <td><button onClick={() => countUP(elm)}>countUP</button>   <button onClick={() => Countdown(elm)}>count down</button> <button onClick={() => Delate(elm)}>Delate</button></td> */}

            </tr>
          })
        }
      </tbody>
    </table>
  </div>

}



